import {useColorModeValue, Text} from '@chakra-ui/react'
import './logo.css'

const Logo = () => {
	const hacker_logo = `../../../images/hacker${useColorModeValue('', '-dark')}.png`

	return (
		<a href='/' scroll={false}>
			<img src={hacker_logo} alt="logo"/>
			<span>Luan Le</span>
		</a>
	)
}

export default Logo
